import axios from "axios";

const BASE_URL = "http://localhost:5000/api/"
const TOKEN = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyMTdkY2Y4OWZlNjNlNjE2ZTE1NjgzOSIsImlzQWRtaW4iOnRydWUsImlhdCI6MTY1ODk1OTA5MSwiZXhwIjoxNjU5MDQ1NDkxfQ.SjhsEIZMOySzns0uN6cwAYUXVO2Bz02ZEBffbLEo3HY";

export const publicRequest = axios.create({
    baseURL: BASE_URL,
});
export const userRequest = axios.create({
    baseURL: BASE_URL,
    header: {token: `Bearer ${TOKEN}`},
});
